import React from 'react';
import logo from './logo.svg';
import './App.css';
import Chart from './components/Chart'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src="https://i.kym-cdn.com/entries/icons/original/000/013/564/doge.jpg" className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>

        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
        <Chart />

      </header>
    </div>
  );
}

export default App;
